import React from "react";
import "../styles/Home.css"; // Import CSS file
// import WallPaper from "../images/Home_WallPaper.png";
import { useNavigate } from "react-router-dom";

export default function Home() {
    const navigate = useNavigate();

    function GameJoin() {
        navigate('/join');
    }

    function handleMouseOver(){
        const button = document.getElementsByTagName("button");
        button.style.opacity = 0.5;
    }

    return (
        <div className="container-fluid bg-image text-center">
            <div className="row">
                <div className="fixed-bottom mb-5 pb-5">
                    <button onMouseOver={handleMouseOver}  onClick={GameJoin} type="button" className="rounded">Let's Start</button>
                </div>
            </div>


            <div className="fixed-bottom">
                <footer className="text-body-secondary text-center text-small mt-md-5">
                    <p className="mb-1">© 2023–2024 GameJHU</p>
                </footer>
            </div>

        </div>
    );
}
